module.exports = "<section class=\"banner\">\n  <div class=\"top-level\">\n    <div class=\"logo\">\n      <img src=\"./assets/images/logo.png\" alt=\"logo\">\n    </div>\n\n    <div class=\"navigation\">\n      <a class=\"btn btn-primary btn-rounded mr-3\" routerLink=\"/login\" role=\"button\">\n        <i class=\"mdi mdi-lock-open-outline\"></i> &nbsp;Login\n      </a>\n      <a class=\"hover-cursor btn btn-rounded btn-primary\" routerLink=\"/register\" role=\"button\">\n        <i class=\"mdi mdi-lock-open-outline\"></i> &nbsp;Signup\n      </a>\n    </div>\n  </div>\n\n  <section class=\"section-one\">\n    <div class=\"jumbotron text-center\">\n      <i class=\"main-icon mdi mdi-file-document-box-multiple-outline\"></i>\n      <p class=\"lead\">\n        Streamline your forms creation, filling and submission process using Forms369.\n      </p>\n      <hr class=\"my-4\">\n      <a class=\"btn btn-primary btn-lg\" href=\"#section1\" role=\"button\">Learn More</a>\n    </div>\n  </section>\n</section>\n\n<section id=\"section1\" class=\"section-two\">\n  <div class=\"container\">\n    <div class=\"text-center mb-5\">\n      <h1 class=\"display-1\">Data Collection & Automation</h1>\n      <p class=\"lead\">Forms369 automates 90% of the processes involved in filling and submitting forms.</p>\n    </div>\n    <div class=\"row text-center\">\n      <div class=\"col-md-4\">\n        <div class=\"card card-highlight hover-cursor hover-primary-inverse\">\n          <div class=\"card-body\">\n            <p class=\"card-title\">Keeping an Up-to-date User Profile</p>\n            <div class=\"card-text\">\n              <i class=\"mdi mdi-database-plus\" style=\"font-size: 8em;\"></i>\n              <p>\n                Forms369 keeps a comprehensive profile for all respondents or clients. \n                During registration, the details provided by a client is added to the user profile. \n                A user also has the opportunity to manage their profile: edit, delete and add more details to their profile. <br><br>\n              </p>\n            </div>\n          </div>\n        </div>\n      </div>\n\n      <div class=\"col-md-4\">\n        <div class=\"card hover-cursor hover-primary\">\n          <div class=\"card-body\">\n            <p class=\"card-title\">Forms Auto-Complete</p>\n            <div class=\"card-text\">\n              <i class=\"mdi mdi-robot\" style=\"font-size: 8em;\"></i>\n              <p>\n                The process of filling a form is fully automated. \n                When filling a form, all details from the respondent's profile are used to autocomplete the form. \n                As the user profile grows, the forms autocomplete process becomes more accurate,  saving respondents \n                an enormous amount of time.\n              </p>\n            </div>\n          </div>\n        </div>\n      </div>\n\n      <div class=\"col-md-4\">\n        <div class=\"card card-highlight hover-cursor hover-primary-inverse\">\n          <div class=\"card-body\">\n            <p class=\"card-title\">Data Auto-sync</p>\n            <div class=\"card-text\">\n              <i class=\"mdi mdi-sync\" style=\"font-size: 8em;\"></i>\n              <p>\n                When filling a form, respondents have the opportunity to edit data in autocompleted \n                field, as well as fill out uncompleted fields. All these changes: editted and new respondent's \n                data from the form filling process are automcatically synched into the client profile, thus\n                maintaining an up-to-date user profile.\n              </p>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</section>\n\n<section class=\"section-three text-center\">\n  <div class=\"container\">\n    <div class=\"jumbotron\">\n      <h1 class=\"display-1\">All Kind of Forms Available.</h1>\n      <p class=\"lead\">We have forms from several of financial institutions, public sector offices, healthcare institutions etc. Search and fill out any form of your choice.</p>\n      <hr class=\"my-4\">\n      <a class=\"btn btn-primary btn-lg\" href=\"#\" role=\"button\">Learn more</a>\n    </div>\n    <div class=\"row\">\n      <div class=\"col-md-12\">\n        <ul class=\"list-group list-group-horizontal-lg\">\n          <li class=\"col-md-3 list-group-item hover-cursor hover-primary\">\n            <i class=\"mdi mdi-message-reply-text\" style=\"font-size: 4em;\"></i>\n            <br>\n            Ghanaian Passport Application Form\n          </li>\n          <li class=\"col-md-3 list-group-item hover-cursor hover-primary\">\n            <i class=\"mdi mdi-file-document-box-multiple-outline\" style=\"font-size: 4em;\"></i>\n            <br>\n            Account Creation Form\n          </li>\n          <li class=\"col-md-3 list-group-item hover-cursor hover-primary\">\n            <i class=\"mdi mdi-file-document-box-outline\" style=\"font-size: 4em;\"></i>\n            <br>\n            Tax Relief Application Form\n          </li>\n          <li class=\"col-md-3 list-group-item hover-cursor hover-primary\">\n            <i class=\"mdi mdi-file-check-outline\" style=\"font-size: 4em;\"></i> \n            <br>\n            Investment Application Form\n          </li>\n        </ul>\n      </div>\n    </div>\n  </div>\n</section>\n\n<section class=\"section-four\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"jumbotron\">\n        <i class=\"mdi mdi-security\" style=\"font-size: 7em;\"></i>\n        <h3 class=\"display-3\">High End Security and Data Protection</h3>\n        <p class=\"lead\">\n          You data is highly secured and protected. \n          At GiT we recognize the importance of protecting your personal information and are committed to processing\n          it responsibly and in compliance with applicable data protection laws in Ghana and other countries GiT will \n          operate. With forms369, companies only have access to respondent's data provided in filled forms.\n        </p>\n      </div>\n    </div>\n  </div>\n</section>\n\n<section class=\"section-five\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-6\">\n        <h3 class=\"display-2\">Two-way Authentication</h3>\n        <p>We use two way authentication: Login and SMS Verification to keep respondents' data secured.</p>\n        <hr>\n        <p class=\"lead\">\n          One of the ways Forms369  keeps its users data secure is by implementing a two-way authentication. \n          After successful login via username and password, a verification code is sent to the users SMS.\n          To fully login and have access to the functionalities of this application, a usr must pass all the 2 stages of authentication.\n        </p>\n      </div>\n      <div class=\"col-md-6\">\n        <i class=\"mdi mdi-message-reply-text\" style=\"font-size: 12em;\"></i>\n      </div>\n    </div>\n  </div>\n</section>\n\n<section class=\"section-six\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-6\">\n        <i class=\"mdi mdi-access-point-network\" style=\"font-size: 12em;\"></i>\n      </div>\n      <div class=\"col-md-6\">\n        <h3 class=\"display-3\">Flexibility and Forms Originality</h3>\n        <p>Print Data in the Original Form Format</p>\n        <hr>\n        <p class=\"lead\">\n          With Forms369, when creating a form, you can also upload the original document of the form that is being created in PDF format. \n          Once a form has been created, published and filled, you have the opportunity to print the original form document with respondents' data. \n          This helps to maintain the originality of the form while making it easy to gather respondents data.\n      </div>\n    </div>\n  </div>\n</section>\n\n<section class=\"section-seven\">\n  <div class=\"container\">\n    <div class=\"headings\">\n      <div class=\"text-center mb-5\">\n        <h1 class=\"display-1\">Forms Creation</h1>\n        <p class=\"lead\">Forms creation made easy with already created Templates and Sections\n        </p>\n      </div>\n    </div>\n    <div class=\"row text-center\">\n      <div class=\"col-md-4\">\n        <div class=\"card hover-cursor hover-primary\">\n          <div class=\"card-body\">\n            <p class=\"card-title\">Form Templates</p>\n            <div class=\"card-text\">\n              <i class=\"mdi mdi-account-arrow-right-outline\" style=\"font-size: 8em;\"></i>\n              <p>\n                To streamline the form creation process on Froms369, several form templates have been created. \n                During form creation, the creators can pick a template that suit their needs from the pool of templates. \n                This chosen template can be editted to include all needed fields.<br><br>\n              </p>\n            </div>\n          </div>\n        </div>\n      </div>\n\n      <div class=\"col-md-4\">\n        <div class=\"card hover-cursor hover-primary\">\n          <div class=\"card-body\">\n            <p class=\"card-title\">Form</p>\n            <div class=\"card-text\">\n              <i class=\"mdi mdi-file-document-box-multiple-outline\" style=\"font-size: 8em;\"></i>\n              <p>\n                Forms369 prides itself on felxibility, speed, security and accuracy. \n                Thus, to provide these benefits to users, particularly during form creation, there is the flexibility to start the form creation from scratch,\n                or use the system's already created sections and templates to smooth-run the form creation process.\n              </p>\n            </div>\n          </div>\n        </div>\n      </div>\n\n      <div class=\"col-md-4\">\n        <div class=\"card hover-cursor hover-primary\">\n          <div class=\"card-body\">\n            <p class=\"card-title\">Form Sections</p>\n            <div class=\"card-text\">\n              <i class=\"mdi mdi-account-arrow-left-outline\" style=\"font-size: 8em;\"></i>\n              <p>\n                Mostly, forms have sections: Personal information, account details, spouse information, educational qualifications etc. \n                During forms creation, these sections can be used to save time and reduce errors.\n                Again, these sections can be editted to fit the users' exact need.\n              </p>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</section>\n\n<footer class=\"footer\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-6 offset-md-3\">\n        <p>Copyright(c) {{ year }}. All rights reserved.</p>\n        <p>theGiTLab</p>\n      </div>\n    </div>\n    <div class=\"row\">\n      <div class=\"col-6 offset-3\">\n        <div class=\"text-center\">\n          <a class=\"white-link\" routerLink=\"/terms\">Terms & Conditions</a> &nbsp; | &nbsp;\n          <a class=\"white-link\" routerLink=\"/privacy\">Privacy Policy</a>\n        </div>\n      </div>\n    </div>\n  </div>\n</footer>"

